<?phpnamespace Nemundo\Roundshot\App\Timelapse\Content\TimelapseVideo;use Nemundo\Content\View\AbstractContentView;use Nemundo\Html\Player\VideoPlayer;class TimelapseVideoContentView extends AbstractContentView{    /**     * @var TimelapseVideoContentType     */    public $contentType;    protected function loadView()    {        $this->viewName = 'default';        $this->viewId = 'f083b2ee-63b1-4958-9405-33aa7802c347';        $this->defaultView = true;    }    public function getContent()    {        $video = new VideoPlayer($this);        $video->addCssClass('mw-100');        $video->src = $this->contentType->getDataRow()->video->getUrl();        return parent::getContent();    }}